import React from "react" ; 

function App()
{
    return(
        <>
        <ol>
        <li>Shivam</li>
        <li>Amit</li>
        <li>Anupam Shukla</li>
        <li>Vishal</li>
        </ol>  
        </>
    ); 
    
}
export default App ;
